import React, {Component} from 'react';
import CardList from './CardList';
import {People} from './People';
import SearchBox from './SearchBox';


class App extends Component {
	constructor(){
		super();
		this.state={
			People:People,
			searchfield:''
		}
	}
	render(){
		return( 
		<div className='tc'>
			<h1 >Robotlar</h1>
			<SearchBox/>
      		<CardList people={People}/>
    	</div>
		);

	}

}

export default App;
